import React from 'react';
import { BrowserRouter, Route, Switch } from 'react-router-dom';

import Landing from './views/Landing';

function App() {
	return (
		<BrowserRouter>
			<Switch>
				<Route path={['/', 'login', 'register']} component={Landing}></Route>
			</Switch>
		</BrowserRouter>
	);
}

export default App;
